			case LINE_STATUS_OFF:
				GUI_SetColor(GUI_GRAY);
				strcpy(timeString, OFF_TEXT);
				break;
			case LINE_STATUS_RUN:
				sprintf(timeString, "%02d:%02d", masterClock.line[3].Hours, masterClock.line[3].Minutes);
				GUI_SetColor(GUI_WHITE);
