void TFT_MainMenu_ShowDate(void)
{

	char str[15];

	sprintf(str, "%02d.%02d.%d ", sDate.Date, sDate.Month, sDate.Year);
	switch (sDate.WeekDay)
	{
	case RTC_WEEKDAY_MONDAY:
		strcat(str, MONDAY_TEXT);
		break;
	case RTC_WEEKDAY_TUESDAY:
		strcat(str, TUESDAY_TEXT);
		break;
	case RTC_WEEKDAY_WEDNESDAY:
		strcat(str, WEDNESDAY_TEXT);
		break;
	case RTC_WEEKDAY_THURSDAY:
		strcat(str, THURSDAY_TEXT);
		break;
	case RTC_WEEKDAY_FRIDAY:
		strcat(str, FRIDAY_TEXT);
		break;
	case RTC_WEEKDAY_SATURDAY:
		strcat(str, SATURDAY_TEXT);
		break;
	case RTC_WEEKDAY_SUNDAY:
		strcat(str, SUNDAY_TEXT);
		break;
	}
	TEXT_SetText(WM_GetDialogItem(masterClock.handles->hMainMenu, ID_TEXT_DATE), str);
	TEXT_SetTextColor(WM_GetDialogItem(masterClock.handles->hMainMenu, ID_TEXT_DATE), GUI_WHITE);

}
void TFT_ShowString(uint16_t x, uint16_t y, char *p, uint8_t fontsize, uint16_t color)
{
	GUI_CHARINFO chinfo;
	uint8_t first1, first2, last1;
	first1 = GUI_FontDigital7Mono70_Prop1.First;
	last1 = GUI_FontDigital7Mono70_Prop1.Last;

	first2 = GUI_FontDigital7Mono70_Prop2.First;
	char ch = '\0';

	while (*p != '\0')
	{
		//if(x>MAX_CHAR_POSX){x=0;y+=12;}
		//if(y>MAX_CHAR_POSY){y=x=0;}
		ch = (*p);
		if (ch > last1)
		{
			ch = *p - (first2 - last1 + first1 - 1);
			TFT_ShowChar(y, x, ch, fontsize, color);
		}
		else
		{
			ch = *p - first1;
			TFT_ShowChar(y, x, ch, fontsize, color);

		}
		chinfo = GUI_FontArial18_CharInfo[ch];

		x += chinfo.XSize;
		p++;
	}
}

